export default function TodoList({ todo }) {
  return (
    <ul>
      {todo.map(
        ({ id, text, completed }) =>
          completed && (
            <li key={id}>
              {text} <button>Delete</button>
            </li>
          )
      )}
    </ul>
  );
}
